package leetCode.juneLeetCodingChallenge.week3;

public class LongestDuplicateSubstring {
    int start, end;

    public String longestDupSubstring(String S) {
        char[] arrS = S.toCharArray();
        int n = arrS.length;

        for (int i = 0; i < n; i++) {
            int p1 = i, p2 = i + 1;

            while (p2 < n) {
                while (p2 < n && arrS[p1] != arrS[p2])
                    p2++;

                if (p2 < n) {
                    int p1Clone = p1, p2Clone = p2;

                    while (p2Clone < n && arrS[p1Clone++] == arrS[p2Clone++]) {
                        if (end - start < p1Clone - p1) {
                            start = p1;
                            end = p1Clone;
                        }
                    }
                }

                p2++;
            }
        }

        return S.substring(start, end);
    }

    public static void main(String[] args) {
        String[] tests = {
                "anana",
                "abcd",
                "",
                "aaaa",
                "abacccababaccc",
                "\""
        };

        for (int i = 0; i < tests.length; i++) {
            LongestDuplicateSubstring s = new LongestDuplicateSubstring();
            System.out.println(
                    s.longestDupSubstring(tests[i])
            );
        }
    }
}
